"use strict";(self.webpackChunkkershner_recipes=self.webpackChunkkershner_recipes||[]).push([[970],{4203:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2024/02/10/lasagna","metadata":{"permalink":"/recipes/2024/02/10/lasagna","editUrl":"https://github.com/dkershner6/recipes/recipes/2024-02-10-lasagna.md","source":"@site/recipes/2024-02-10-lasagna.md","title":"Keto Lasagna","description":"Keto Lasagna recipe, both nutritious and delicious.","date":"2024-02-10T00:00:00.000Z","formattedDate":"February 10, 2024","tags":[{"label":"comfort","permalink":"/recipes/tags/comfort"},{"label":"italian","permalink":"/recipes/tags/italian"},{"label":"keto","permalink":"/recipes/tags/keto"},{"label":"savory","permalink":"/recipes/tags/savory"},{"label":"tried-and-true","permalink":"/recipes/tags/tried-and-true"}],"readingTime":1.15,"hasTruncateMarker":false,"authors":[{"name":"Derek Kershner","title":"Sous Chef","url":"https://github.com/dkershner6","imageURL":"https://avatars.githubusercontent.com/u/25798427?s=400&u=a64040907ad0c23d4beb5bc08d8f99374e19ee00&v=4","key":"dkershner"}],"frontMatter":{"title":"Keto Lasagna","description":"Keto Lasagna recipe, both nutritious and delicious.","authors":"dkershner","tags":["comfort","italian","keto","savory","tried-and-true"]}},"content":"## Ingredients\\n\\n### Sauce\\n\\n-   1/4 cup extra virgin olive oil\\n-   1-1.5 lb ground turkey\\n-   1 stalk Celery\\n-   1 medium yellow onion\\n-   6 cloves garlic (or more, to taste)\\n-   2 Pints Chicken Stock\\n-   1/2 cup red wine (any)\\n-   2 pinches Italian Seasoning\\n-   2 bay leaf\\n-   2 Roma tomatoes\\n-   1 bunch collard greens (about 6-7 leaves)\\n-   1 cup almond flour\\n-   Calabrian Chili Flakes (to taste)\\n-   Salt (to taste)\\n-   Pepper (to taste)\\n\\n### Lasagna\\n\\n-   2 cans heart of palm lasagna noodles\\n-   14 oz queso fresco\\n-   Bit of grated parmesan\\n\\n## Instructions\\n\\n### Sauce\\n\\n1. In dutch oven or pot, olive oil and diced onion and celery until translucent.\\n2. Brown ground turkey, minced garlic, then add chicken stock. Bring back to light boil / simmer.\\n3. Add Italian seasoning, bay leaf, calabrian chili flakes, and red wine.\\n4. Remove ribs from collards, roughly chop, add.\\n5. Simmer for hours, at least 1-2.\\n6. Chop and add tomatoes.\\n7. Add almond flour.\\n8. Simmer for half hour.\\n9. Add salt, pepper.\\n\\n### Lasagna\\n\\n1. Preheat oven to 375F.\\n2. In Pyrex or similar baking dish, layer noodles, then sauce, then queso fresco, then parmesan 3 times each.\\n3. Top with pepper.\\n4. Bake for an hour until cheese is browned.\\n\\nWait a bit, then eat. Enjoy!"}]}')}}]);